script: |
  super -f text -I q8090.spq | sort > q8090.out

inputs:
  - name: q8090.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN ( col0 ) AND ( - - CAST ( + CAST ( NULL AS INTEGER ) AS INTEGER ) ) * + col2 * - col2;
  - name: tab2

outputs:
  - name: q8090.out
    data: |
